results.resultText:
In dreamy eyelids slumbering,I find my heart's true wonder;
A world where imagination sings,And reality it does engage.

Bright colors blaze before me,Sounds of laughter they do gleefully bore me;
Creatures both fantastical and real,Dance on dreams as if they were mystical heal.

The sun in dreams never sets,Nor the moon ever rests;
If I could only stay inside,I'd wish this dream world would abide.

But alas, with every waking breath,Reality does encroach;
And like a cruel and bitter thief,It steals my heart's gentle loot.

Yet still, in dreams I roam,Fleeing from the harsh light of dawn;
For there, imagination reigns supreme,And I am free to be what I want to be.

So let us all seek refuge,In our minds where fantasy resides;
There we can find solace and relief,From the weight of the world's despicable lies.

Oh, if only we could bring that dreamy glow,To chase away the shadows that surround;
Then perhaps our hearts would never know,The cold embrace of the ground.
